import { Text, Title } from "@tremor/react";
import Head from "next/head";
import Image from "next/image";
import { SocialIcon } from "react-social-icons";

const teamMembers = [
  {
    id: 1,
    name: "Youssef Mohamed",
    role: "CTO",
    photo: "/team/Y.jpg",
    description: "Back-End",
    social: {
      facebook: "https://facebook.com/flepoooo",
      linkedin: "https://www.linkedin.com/in/flepooo",
      github: "https://github.com/flepooo",
    },
  },
  {
    id: 2,
    name: "Eslam Eid",
    role: "CEO",
    photo: "/team/E.jpg",
    description: "Head of Front-End",
    social: {
      facebook: "https://facebook.com/flepoooo",
      linkedin: "https://www.linkedin.com/in/flepooo",
      github: "https://github.com/flepooo",
    },
  },
  {
    id: 3,
    name: "Basem Mohamed",
    role: "Dev",
    photo: "/team/B.jpeg",
    description: "Front-End",
    social: {
      facebook: "https://facebook.com/flepoooo",
      linkedin: "https://www.linkedin.com/in/flepooo",
      github: "https://github.com/flepooo",
    },
  },
  {
    id: 4,
    name: "Ahmed Salah",
    role: "Dev",
    photo: "/team/A.jpeg",
    description: "Front-End",
    social: {
      facebook: "https://facebook.com/flepoooo",
      linkedin: "https://www.linkedin.com/in/flepooo",
      github: "https://github.com/flepooo",
    },
  },
  // Add more team members here
];

const About = () => {
  return (
    <main className="p-4 md:p-10 mx-auto max-w-7xl">
      <div className="container mx-auto py-8">
        <Title className="text-4xl font-bold mb-4">About Us</Title>
        <Text className="text-lg mb-8">
          Welcome to our company! We are a team of passionate individuals
          dedicated to making the world a better place through technology.
        </Text>
        <Title className="text-2xl font-bold mb-4">Our Team</Title>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-4">
          {teamMembers.map((member) => (
            <div key={member.id} className="border p-4 rounded-lg">
              <div className="flex justify-center">
                <img
                  src={member.photo}
                  alt={member.name}
                  className="rounded-full"
                />
              </div>
              <div className="text-center mt-4">
                <Title className="text-xl font-bold">{member.name}</Title>
                <Text className="text-gray-600 mb-2">{member.role}</Text>
                <Text>{member.description}</Text>
                <div className="flex justify-center mt-4">
                  <span
                    key={member.id}
                    href={member.social.github}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="mr-4"
                  >
                    <SocialIcon
                      style={{ width: 30, height: 30 }}
                      url={member.social.github}
                    />
                  </span>
                  <span
                    key={member.id}
                    href={member.social.linkedin}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="mr-4"
                  >
                    <SocialIcon
                      style={{ width: 30, height: 30 }}
                      url={member.social.linkedin}
                    />
                  </span>
                  <span
                    key={member.id}
                    href={member.social.facebook}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="mr-4"
                  >
                    <SocialIcon
                      style={{ width: 30, height: 30 }}
                      url={member.social.facebook}
                    />
                  </span>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
      <Title className="text-lg font-medium my-3">
        © Copyright Mathematics Dept. All Rights Reserved.
      </Title>
      <Text>Designed by DevelopmentTeam</Text>
    </main>
  );
};

export default About;
